import React from 'react'
import { Link, Outlet } from 'react-router-dom';

export default function News() {
  const messages = [
    { id: "001", name: "张三", msg: "1" },
    { id: "002", name: "李四", msg: "2" },
    { id: "003", name: "王五", msg: "3" },
  ]
  return (
    <div>
      <ul>
        {
          messages.map((m) => {
            return <li key={m.id}>
              <Link to="detail/${m.id}/${m.name}/${m.msg}">{m.name}</Link>
            </li>
          })
        }
      </ul>
      
      <Outlet></Outlet>
    </div>
  )
}
